# -*- coding: utf-8 -*-
"""
安全的关于信息模块
包含内嵌的支付二维码和完整性校验
除版本号外，任何内容被修改都将导致程序无法启动
二维码图片以 Base64 形式嵌入，不依赖外部文件
"""

import base64
import hashlib
from typing import Optional, Tuple

# ============================================================================
# 安全配置 - 请勿修改以下任何内容，否则程序将无法启动
# ============================================================================

# 内容签名密钥
_SIGNATURE_SALT = b"FSmatbinBD_CCX_2026_Secure"

# 核心信息（受保护）
_APP_NAME = "FSmatbinBD"
_DEVELOPER = "CCX"
_GITHUB_REPO = "https://github.com/ccccxp/FSmatbinBD"
_COPYRIGHT_YEARS = "2025-2026"

# 二维码数据标识（用于完整性验证）
_WECHAT_QR_ID = "WX_PAY_QR_2026"
_ALIPAY_QR_ID = "ALI_PAY_QR_2026"

# ============================================================================
# 内嵌的二维码图片数据 (Base64 编码)
# ============================================================================

_WECHAT_QR_B64 = ""

_ALIPAY_QR_B64 = ""

# ============================================================================
# 完整性校验函数
# ============================================================================

def _compute_content_hash() -> str:
    """计算受保护内容的哈希值"""
    content = (
        _APP_NAME +
        _DEVELOPER +
        _GITHUB_REPO +
        _COPYRIGHT_YEARS +
        _WECHAT_QR_ID +
        _ALIPAY_QR_ID
    )
    h = hashlib.sha256()
    h.update(_SIGNATURE_SALT)
    h.update(content.encode('utf-8'))
    return h.hexdigest()[:32]


# 计算实际签名
_COMPUTED_SIGNATURE = _compute_content_hash()

# 预期签名（基于上述受保护内容）
_EXPECTED_SIGNATURE = "7faf02cd83cf68adff17a5cf7025d933"


def verify_integrity() -> bool:
    """
    验证模块完整性
    返回 True 表示验证通过，False 表示内容已被篡改
    """
    return _COMPUTED_SIGNATURE == _EXPECTED_SIGNATURE


def get_integrity_error_message() -> str:
    """获取完整性错误消息"""
    return (
        "程序完整性校验失败！\n"
        "Program integrity check failed!\n\n"
        "关于信息已被修改，程序无法启动。\n"
        "The about information has been modified. Program cannot start.\n\n"
        "请重新下载原版程序。\n"
        "Please download the original program again."
    )


# ============================================================================
# 公开接口
# ============================================================================

def get_app_name() -> str:
    """获取应用名称"""
    return _APP_NAME


def get_developer() -> str:
    """获取开发者名称"""
    return _DEVELOPER


def get_github_repo() -> str:
    """获取 GitHub 仓库地址"""
    return _GITHUB_REPO


def get_copyright_years() -> str:
    """获取版权年份"""
    return _COPYRIGHT_YEARS


def get_about_info() -> dict:
    """获取所有关于信息"""
    return {
        'app_name': _APP_NAME,
        'developer': _DEVELOPER,
        'github_repo': _GITHUB_REPO,
        'copyright_years': _COPYRIGHT_YEARS,
    }


# ============================================================================
# 二维码相关
# ============================================================================

def get_qr_images() -> Tuple[Optional[bytes], Optional[bytes]]:
    """
    获取二维码图片数据（从内嵌的 Base64 解码）
    返回: (wechat_image_bytes, alipay_image_bytes)
    """
    wechat_data = None
    alipay_data = None
    
    try:
        wechat_data = base64.b64decode(_WECHAT_QR_B64)
    except Exception:
        pass
    
    try:
        alipay_data = base64.b64decode(_ALIPAY_QR_B64)
    except Exception:
        pass
    
    return wechat_data, alipay_data


# ============================================================================
# 开发工具
# ============================================================================

def print_signature():
    """打印当前内容的签名（用于发布前更新 _EXPECTED_SIGNATURE）"""
    sig = _compute_content_hash()
    print(f"当前内容签名: {sig}")
    print(f"请将此值更新到 _EXPECTED_SIGNATURE")


if __name__ == "__main__":
    print_signature()
    print(f"\n验证结果: {'通过' if verify_integrity() else '失败'}")
